oltip:"ນອກຈາກການຕອບຄຳຖາມທົ່ວໄປແລ້ວ, Copilot ຍັງສາມາດຕອບສະໜອງຕໍ່ຄຳຂໍທີ່ກ່ຽວຂ້ອງກັບເອກະສານນີ້ ຫຼື ຂໍ້ມູນຂອງອົງກອນ ເຊັ່ນ: ໄຟລ໌ ແລະ ຂໍ້ມູນຕິດຕໍ່ຂອງຜູ້ຄົນ.",GroundingSourceInformationTooltipV2:'ສໍາລັບຄໍາຖາມທົ່ວໄປແລະເຮັດວຽກກ່ຽວກັບເນື້ອຫາຂອງທ່ານ, ໃຫ້ໃຊ້ "ເອກະສານນີ້". ສໍາລັບຄໍາຖາມທີ່ກ່ຽວຂ້ອງກັບອົງການຂອງທ່ານ, ບໍ່ກ່ຽວຂ້ອງກັບການສ້າງຫຼືການແກ້ໄຂເນື້ອຫາ, ໃຫ້ໃຊ້ "ຂໍ້ມູນຂອງອົງການຂອງທ່ານ".',GroundingDocToWorkModeSwitchMessage:"ຂ້ອຍກໍາລັງໃຊ້ຂໍ້ມູນຂອງອົງການຂອງທ່ານເພື່ອຕອບສະຫນອງທ່ານ. ຖາມຂ້າພະເຈົ້າຄໍາຖາມກ່ຽວກັບຄົນແລະໄຟລ໌ໃນທົ່ວອົງກອນຂອງທ່ານ. ໃຫ້ສັງເກດວ່າຂ້ອຍຈະບໍ່ສາມາດເຮັດວຽກກັບເນື້ອຫາຂອງທ່ານໃນຂະນະທີ່ຂ້ອຍຢູ່ໃນຮູບແບບນີ້.",GroundingWorkToDocModeSwitchMessage:"ຂ້ອຍກຳລັງໃຊ້ເອກະສານນີ້ ແລະ ຄວາມຮູ້ທົ່ວໄປເພື່ອຕອບກັບຫາທ່ານ. ຖາມຄຳຖາມກັບຂ້ອຍ ແລະ ເຮັດຄຳຂໍເພື່ອເຮັດວຽກກັບເອກະສານນີ້.",ChatHistoryHydrationError:"ຖ້າສິ່ງນີ້ເປັນຄວາມຕໍ່ເນື່ອງຂອງການແຊັດກ່ອນໜ້າ ແລະ ທ່ານຕ້ອງການປະຫວັດການແຊັດ, ໃຫ້ປິດ ແລະ ເປີດບານໜ້າຕ່າງຄືນໃໝ່.",CopilotUnsupportedlanguageMessage:"ຄຳຂໍຂອງທ່ານລວມມີພາສາທີ່ Copilot ບໍ່ຮອງຮັບໃນຂະນະນີ້.",CopilotUnsupportedLanguageError:"ຂ້າພະເຈົ້າຍັງບໍ່ໄດ້ສະຫນັບສະຫນູນ %s. ສໍາລັບລາຍການພາສາທີ່ໄດ້ຮັບການສະຫນັບສະຫນູນ, ກະລຸນາເຂົ້າເບິ່ງ ",CopilotSupportedLanguagesLearnMoreLink:"ພາສາທີ່ຮອງຮັບສໍາລັບ Microsoft Copilot",DisengagedError:"ຂໍອະໄພ, ຂ້ອຍບໍ່ສາມາດແຊັດກ່ຽວກັບສິ່ງນີ້ໄດ້. ເພື່ອບັນທຶກການແຊັດ ແລະ ເລີ່ມຕົ້ນການແຊັດໃໝ່, ເລືອກ ການແຊັດໃໝ່.",FeedbackPrompt:"ຖ້າທ່ານຮູ້ສຶກວ່າຂ້ອຍເຂົ້າໃຈຜິດ, ກະລຸນາສົ່ງຄໍາຕິຊົມ.",ZQMV2RedactFromFilePrompt:"ແກ້ໄຂ [ຂໍ້ມູນທີ່ເປັນຄວາມລັບຈາກເອກະສານນີ້] ທັງໝົດ",ZQMV2AskItemDescTimeMgmt:"ຂ້ອຍສາມາດອະທິບາຍ [ການຈັດການເວລາ] ໃຫ້ຫຍໍ້ໆໄດ້ແນວໃດ?",ZQMV2AskItemEnterpriseSearch:"ເອກະສານໃດທີ່ຂ້ອຍຄວນອ່ານ [ກ່ອນທີ່ຂ້ອຍຈະພົບກັບຜູ້ຈັດການຂອງຂ້ອຍໃນອາທິດນີ້?]",ZQMV2AskItemWebSearch:"ອັດຕາແລກປ່ຽນໃນປັດຈຸບັນຂອງ [USD?]",ProactiveZQMTitle_1:"ເລີ່ມຕົ້ນສະບັບຮ່າງ",ProactiveZQMTitleText_1:"ສ້າງຄຳຖາມທີ່ມີຄົນຖາມເລື້ອຍໆ ໃນ [doc]",ProactiveZQMTitle_2:"ຂຽນບົດແນະນໍາ",ProactiveZQMTitleText_2:"ຂຽນຫຍໍ້ໜ້າແນະນຳທີ່ໜ້າສົນໃຈໃສ່ [doc]",ProactiveZQMTitle_3:"ສື່ສານປະເດັນຂອງທ່ານ!",ProactiveZQMTitleText_3:"ຮ່າງຂໍ້ພິສູດໂຕ້ແຍ່ງໃສ່ [file]",P